ooze.module("modules.EntryPoint")







.require('shared.kinetic', 'KineticExtensions')
.require('shared.kinetic', 'FpsMonitor')
//.require('./', 'GameUtils')
.require('./', 'ParticleFall')
.require('./', 'NumberGrid')
.require('./', 'EnemiesGroup')
.require('./', 'Keypad')
.require('./', 'StartScreen')
.require('./', 'Missile')
.require('./', 'Dashboard')
.require('./', 'GameLogic')

.init(function(module, imports) {
/* ============================================ */

var KineticExtensions = imports.KineticExtensions;

var stageW = Math.min($(document).width(), 320);
var stageH = Math.min($(document).height(), 560);

stageW = $(document).width();
stageH = $(document).height();

//Constants
var BACKGROUND_FILL = '#2980b9';
var PARTICLE_FILL = 'white', PARTICLE_OPACITY = .2;

var GameLogic = imports.GameLogic;

module.extern.start = function() {
    document.title='kinetic';

    // Scrollstop
    //$('body, .page-container').scrollStop();


    /* ======= STAGE ======= */
    var stage = new Kinetic.Stage({
        container: 'surface-container',
        width: stageW,
        height: stageH
    });



    /* ======= BACKGROUND ======= */
    var backgroundLayer = new Kinetic.Layer({
      listening: false
    });
    backgroundLayer.add(new Kinetic.Rect({
      width  : stage.getWidth(),
      height : stage.getHeight(),
      fill   : BACKGROUND_FILL
    }));



    /* ======= PARTICLE FALL ======= */
    var particleFallLayer = new Kinetic.Layer({
        width : stage.getWidth(),
        height: stage.getHeight(),
        listening: false
    });

    var particleFall = new imports.ParticleFall({
        width : stage.getWidth(),
        height: stage.getHeight(),
        particleFill  : PARTICLE_FILL,
        particleOpacity: PARTICLE_OPACITY,
        autoDraw   : true,
    });
    particleFallLayer.add(particleFall);



    /* ======= ENEMIES ======= */
    var enemiesLayer = new Kinetic.Layer({
        listening : false
    });
    var enemies = imports.EnemiesGroup();
    enemies.setX((stage.getWidth() - enemies.getWidth())/2);
    enemies.setY(20);
    enemiesLayer.add(enemies);



    /* ======= GRID ======= */
    var dimension  = Math.min(stage.getWidth(), stage.getHeight());
    var gridMargin = Math.floor(dimension / 8);
    var gridEdge   = Math.floor(dimension - 2*gridMargin);
    var gridLayer  = new Kinetic.Layer({
        x: Math.floor((stage.getWidth() - gridEdge) / 2),
        y: Math.floor((stage.getHeight() - gridEdge) / 2),
        listening:false
    });
    var grid = imports.NumberGrid({
        width: gridEdge,
        height: gridEdge,
        legend: true
    });
    gridLayer.add(grid);



    /* ======= MISSILES ======= */
    var missilesLayer = new Kinetic.Layer({
        listening : false
    });



    /* ======= KEYPAD ======= */
    var keypadLayer = new Kinetic.Layer({
        listening : true
    });
    var keypad = imports.Keypad();
    keypad.setX( (stage.getWidth() - keypad.getWidth())/2);
    keypad.setY(stage.getHeight() - keypad.getHeight() - 2);
    keypadLayer.add(keypad);



    /* ======= DASHBOARD ======= */
    var dashboardLayer = new Kinetic.Layer({
        listening : false
    });
    var dashboard = imports.Dashboard({
        x : 10,
        y: 40
    });
    dashboardLayer.add(dashboard);


    /* ======= START SCREEN ======= */
    var startScreenLayer = new Kinetic.Layer({
        listening: true
    });

    function showStartScreen() {
        keypad.enable(false);
        enemies.reset();
        grid.reset();
        grid.animate(false);

        var startScreen = imports.StartScreen({
            width: stage.getWidth(),
            height: stage.getHeight()
        });
        startScreen.on('click tap', function() {
            startScreen.remove();
            startScreenLayer.batchDraw();
            GameLogic.startLevel();
        });
        startScreenLayer.add(startScreen);
        stage.draw();
    }


    /* ======= FPS ======= */
    var fpsMonitorLayer = imports.FpsMonitor({ x: 10, y: 10, text : { fill: 'yellow' } });



    /* ======= COMPOSE STAGE ======= */
    stage.add(backgroundLayer);
    stage.add(particleFallLayer);
    stage.add(enemiesLayer);
    stage.add(gridLayer);
    stage.add(missilesLayer);
    stage.add(keypadLayer);
    stage.add(dashboardLayer);
    stage.add(startScreenLayer);
    stage.add(fpsMonitorLayer.start());


    /* ======= SHOW START SCREEN ======= */

    // Show start screen
    showStartScreen();


    /* ======= Launch ======= */

    function moveEnemyToTarget(enemy) {

        // Get the next target
        var target = GameLogic.nextTarget();

        // If we got no target it means we are done with the current enemy.
        if(!target) {
            // ... dispose the enemy
            enemy.destroy();
            // Launch next (if any)
            launchNextEnemy();
            return;
        }

        // Get positions of the next target
        var targetPositions = grid.getTargetPositions(target.fx, target.fy);

        // Disable keypad as shooting is not allowed here
        keypad.enable(false);

        // Move enemy to position
        enemy.tweenToAbsolutePosition(targetPositions.shift(), {
            // ... when done ...
            onComplete : function() {
                // Mark the target in the grid
                grid.markTarget(target.fx, target.fy);
                // Enable the keypad since shooting is allowed
                keypad.enable(true);
            }
        });

    }

    function launchNextEnemy() {

        keypad.enable(false);

        // Show/hide legend depending on the enemy index
        // (1:show all, 2:show x, 3: hide all)
        var index = enemies.nextIndex();
        switch(index) {
            case 1:
                grid.showLegend(true);
                break;
            case 2:
                grid.showLegendX(true);
                grid.showLegendY(false);
                break;
            case 3:
                grid.showLegend(false);
                break;
            case 4:
                // There are no more enemies here. Game over.
                _.defer(function() {
                    alert('Game over. Total points: ' + GameLogic.get('points'));
                    location.reload();
                })
                return;
        }

        // Launch enemy
        enemies.launchNext(function(enemy) {
            // Move it to the next target when it's ready
            moveEnemyToTarget(enemy);
        });
    }

    /* ======= EVENT HANDLERS ======= */

    // Upon start, launch the next enemy
    GameLogic.on('game:start', function(options) {
        launchNextEnemy();
    });

    // handle shooting
    GameLogic.on('game:shoot', function(operands) {

        var targetPositions = grid.getTargetPositions(operands.fx, operands.fy);
        module.logd('Missiles target positions:', JSON.stringify(targetPositions));

        var target = GameLogic.get('target');
        // module.logw('SUCCESS:', target.fx * target.fy === operands.fx * operands.fy);

        var launchPadPosition = keypad.launchPoint();


        var timeline = new TimelineMax({
            onComplete : function() {
                // Check if we got it right
                var target = GameLogic.get('target');
                var result = target.fx * target.fy;
                if(operands.fx * operands.fy === result) {
                    var points = GameLogic.get('points');
                    GameLogic.set('points', points + 1);
                } else {
                    var asinello = GameLogic.get('asinello');
                    GameLogic.set('asinello', asinello + 1);

                    var messageLayer = new Kinetic.Layer;
                    var message = new Kinetic.Text({
                        text: 'ASINELLO !!!',
                        fontSize: 24,
                        fontFamily: 'Helvetica Neue',
                        fontStyle: 'bold',
                        fill: 'red',
                        listening : false
                    });
                    message.setX((stage.getWidth() - message.getTextWidth())/2);
                    message.setY(110);
                    messageLayer.add(message);
                    stage.add(messageLayer);

                    TweenMax.to(message, 1, {
                        delay: 1,
                        kinetic:{
                            opacity:0
                        },
                        onComplete : function() {
                            messageLayer.destroy()
                        }
                    });
                }

                // FIXME: use a timeline instead

                // Unmark grid
                grid.unmarkTarget();

                _.delay(function() {
                    GameLogic.set('shooting', false);
                    // Move enemy
                    var enemy = enemies.current();
                    moveEnemyToTarget(enemy);
                }, 2000);
            }
        })

        _(targetPositions).each(function(targetPosition, index) {
            var missile = imports.Missile();
            missilesLayer.add(missile);

            var pos = KineticExtensions.relativeFromAbsolute(missile, launchPadPosition);
            missile.setPosition(pos);

            var tween = missile.tweenToAbsolutePosition(targetPosition, {
                // ... when done ...
                onComplete : function() {
                    missile.showTooltip(targetPosition.fx, targetPosition.fy);
                    TweenMax.to(missile.get('.missile')[0], .5, {
                        kinetic:{height:10,opacity:0,y:'-=5',autoDraw:false},
                        onUpdate : missilesLayer.batchDraw,
                        onUpdateScope: missilesLayer
                    });
                    TweenMax.to(missile, .5, {
                        delay: 2,
                        kinetic:{opacity:0,autoDraw:false},
                        onUpdate : missilesLayer.batchDraw,
                        onUpdateScope: missilesLayer,
                        onComplete : function() {
                            missile.destroy();
                        }
                    });
                }
            });
            timeline.add(tween, 0);

            missilesLayer.batchDraw();

        })

    })

}



/* ============================================ */
});

